import React, { useContext, useState } from "react";
import "./Navbar.css";
import { assets } from "../assets/assets/assets.js";
import { Link } from "react-router-dom";
import { BsFillMoonFill } from "react-icons/bs/index.esm.js";
import { BsFillSunFill } from "react-icons/bs/index.esm.js";
import { StoreContext } from "../../context/StoreContext.js";

const Navbar = ({ setShowlogin }) => {
  const [menu, setMenu] = useState("");
  const {subTotal,darktheme} =useContext(StoreContext)
  const list = (val) => {
    return setMenu(val);
  };
  
  return (

    <div className="navbar">
     
      <Link to="/">
        <img src={assets.logo} alt="food" className="logo" />
      </Link>

      <ul className="navmenu">
        <Link
          to="/"
          onClick={() => setMenu("home")}
          className={menu === "home" ? "active" : ""}
        > Home</Link>
        <a
          href="#exploer-menu"
          onClick={() => setMenu("menu")}
          className={menu === "menu" ? "active" : ""}
        >
          Menu
        </a>
        <a
          href="#app-download"
          onClick={() => setMenu("ma")}
          className={menu === "ma" ? "active" : ""}
        >
          mobile-app
        </a>
        <a
          href="#footer"
          onClick={() => setMenu("contact")}
          className={menu === "contact" ? "active" : ""}
        >
          Contact us
        </a>
      </ul>
      <div className="navbar-right">
        <img src={assets.search_icon} alt="" />
        <div className="navabar-search-icon">
         <Link to="/cart"><img src={assets.basket_icon} alt="" /></Link>
          <div className={subTotal()===0?"":"dot"}> </div>
        </div>
        <button onClick={() => setShowlogin(true)} on>
          Sign in
        </button>
      </div>
    <div
  style={{
    backgroundColor: "#1c1c1c",
  }}
>
  <BsFillMoonFill
    style={{
      color: "#ffffff",
    }}
  />
</div>
    </div>
  );
};

export { Navbar };
